{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amirmotefaker/sentiment-analysis-model-using-r?scriptVersionId=178740048\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"c9a08b61","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.00731,"end_time":"2024-05-20T11:45:41.050148","exception":false,"start_time":"2024-05-20T11:45:41.042838","status":"completed"},"tags":[]},"source":["# What is Sentiment Analysis?\n","- Sentiment analysis is the process of analyzing digital text to determine if the emotional tone of the message is positive, negative, or neutral. Today, companies have large volumes of text data like emails, customer support chat transcripts, social media comments, and reviews. Sentiment analysis tools can scan this text to automatically determine the author’s attitude towards a topic. Companies use the insights from sentiment analysis to improve customer service and increase brand reputation. \n","# Why is sentiment analysis important?\n"," - Provide objective insights\n"," - Build better products and services\n"," - Analyze at scale\n"," - Real-time results\n"," \n","# What are sentiment analysis use cases?\n","  - Improve customer service\n","  - Brand monitoring\n","  - Market research\n","  - Track campaign performance\n","  \n","# What are the different types of sentiment analysis?\n"," - Fine-grained scoring\n"," - Aspect-based\n"," - Intent-based\n"," - Emotional detection\n"," \n","\n","##### Reference : [Amazon](https://aws.amazon.com/what-is/sentiment-analysis/)\n","\n","\n","# Sentiment Analysis Model:\n","- We will carry out sentiment analysis with R in this project. The dataset that we will use will be provided by the R package ‘janeaustenR’.\n","\n","## janeaustenr: Jane Austen's Complete Novels:\n","- Full texts for Jane Austen's 6 completed novels, ready for text analysis. These novels are \"Sense and Sensibility\", \"Pride and Prejudice\", \"Mansfield Park\", \"Emma\", \"Northanger Abbey\", and \"Persuasion\". [janeaustenr](https://cran.r-project.org/web/packages/janeaustenr/index.html)\n","\n","\n","- In order to build our project on sentiment analysis, we will make use of the tidytext package that comprises sentiment lexicons that are present in the dataset of ‘sentiments’."]},{"cell_type":"markdown","id":"42d2a51a","metadata":{"papermill":{"duration":0.005749,"end_time":"2024-05-20T11:45:41.0618","exception":false,"start_time":"2024-05-20T11:45:41.056051","status":"completed"},"tags":[]},"source":["# Install Libraries"]},{"cell_type":"code","execution_count":1,"id":"15817fb3","metadata":{"execution":{"iopub.execute_input":"2024-05-20T11:45:41.079536Z","iopub.status.busy":"2024-05-20T11:45:41.076828Z","iopub.status.idle":"2024-05-20T11:46:51.176783Z","shell.execute_reply":"2024-05-20T11:46:51.174844Z"},"papermill":{"duration":70.11169,"end_time":"2024-05-20T11:46:51.179859","exception":false,"start_time":"2024-05-20T11:45:41.068169","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","also installing the dependencies ‘pillar’, ‘rlang’, ‘tibble’, ‘vctrs’, ‘dplyr’\n","\n","\n","Warning message in install.packages(\"tidytext\"):\n","“installation of package ‘rlang’ had non-zero exit status”\n","Warning message in install.packages(\"tidytext\"):\n","“installation of package ‘vctrs’ had non-zero exit status”\n","Warning message in install.packages(\"tidytext\"):\n","“installation of package ‘pillar’ had non-zero exit status”\n","Warning message in install.packages(\"tidytext\"):\n","“installation of package ‘tibble’ had non-zero exit status”\n